// ------------------------------------------------------------
// Callback: Edge Impulse pulls data from here
// ------------------------------------------------------------
static int get_signal_data(size_t offset, size_t length, float *out_ptr) {
    for (size_t i = 0; i < length; i++) {
        out_ptr[i] = input_buf[offset + i];
    }
    return EIDSP_OK;
}

int main(void) {

    printf("Glass Break Detection (Offline Test)\n");

    // Check buffer length
    const size_t buf_len = sizeof(input_buf) / sizeof(input_buf[0]);
    if (buf_len != EI_CLASSIFIER_RAW_SAMPLE_COUNT) {
        printf("ERROR: Invalid input buffer length\n");
        printf("Expected %d samples, got %d\n",
               EI_CLASSIFIER_RAW_SAMPLE_COUNT,
               (int)buf_len);
        return 1;
    }

    // Create signal wrapper
    signal_t signal;
    signal.total_length = EI_CLASSIFIER_RAW_SAMPLE_COUNT;
    signal.get_data = get_signal_data;

    // Result struct
    ei_impulse_result_t result = { 0 };

    // Run inference
    EI_IMPULSE_ERROR res = run_classifier(&signal, &result, false);
    if (res != EI_IMPULSE_OK) {
        printf("run_classifier failed (%d)\n", res);
        return 1;
    }

    // Timing info
    printf("Timing (ms): DSP=%d, Inference=%d\n",
           result.timing.dsp,
           result.timing.classification);

    // ------------------------------------------------------------
    // Classification results
    // ------------------------------------------------------------
    printf("Predictions:\n");

    float glass_prob = 0.0f;

    for (uint16_t i = 0; i < EI_CLASSIFIER_LABEL_COUNT; i++) {
        const char *label = result.classification[i].label;
        float value = result.classification[i].value;

        printf("  %s: %.5f\n", label, value);

        if (strcmp(label, "glass_break") == 0) {
            glass_prob = value;
        }
    }

    // ------------------------------------------------------------
    // Decision logic
    // ------------------------------------------------------------
    const float THRESHOLD = 0.7f;

    if (glass_prob > THRESHOLD) {
        printf(">>> GLASS BREAK DETECTED <<<\n");
    } else {
        printf("No glass break detected\n");
    }

#if EI_CLASSIFIER_HAS_ANOMALY == 1
    printf("Anomaly score: %.3f\n", result.anomaly);
#endif

    return 0;
}
